package com.java.first;

public class DoWhile {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
//while -Runs until condition meet
		//do while -run atleast once
	
		int i=10;
		do {
			System.out.println(2*i);
			i++;
		}while(i<=10);
	}

}
